        <Navbar.Brand href="/">Energenius</Navbar.Brand>
        <Navbar.Collapse>
          <Nav>
           <Nav.Link href="/">Home</Nav.Link>
           <Nav.Link href='/energy'>Energy Category</Nav.Link>
